import  CreatePoll from '../new_poll/CreatePoll';
import "./Page.css"

const Home = () => {
    return (
        <body id="CreateForm">
            <div className="parent-container">
                <div className="images"></div>

            <div className="container">

                <h2 className="headline"></h2>
        <CreatePoll />
            </div>
        </div>
        </body>
    );
}

export default Home;
